import { useParams } from 'react-router-dom';
import React from 'react';
const { name, apellido } = useParams();


function Nosotros() {
    return(
            <Container maxWidth="md">

                <h2>Nosotros</h2>
            </Container>
    )
}
export default Nosotros;
